// NextPage.js
import React from 'react';
import './NextPage.css'; // Optional: If you have CSS for styling

const NextPage = () => {
    return (
        <div className="next-page-container">
            <h1>Welcome to the Next Page!</h1>
            <p>This is where you can add more content or functionality.</p>
        </div>
    );
};

export default NextPage;
